import ExpenseItem from "./ExpenseItem";
import "./Expenses.css"


export default function Expenses(props) {
    return (
        <div>
            {props.expenses.map((expense) => <div className="expenses"><ExpenseItem key={expense.id} name={expense.title} amount={expense.amount} date={expense.date}/></div>)}
        </div>
    );
}
